import React from "react";
import { Link } from "react-router-dom";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faFaceBook, faCoffee } from '@fortawesome/free-solid-svg-icons';
import {
  Nav,
  Col,
  Image
} from 'react-bootstrap';

export default function FooterNav() {
  return (
      <Nav className='container-fluid d-flex justify-content-center text-center text-white bg-dark' >
            <Col>
            <div className="">

              <Link className="btn btn-outline-light m-4" href="#"><FontAwesomeIcon icon="coffee" /><FontAwesomeIcon icon={faFaceBook} /></Link>

              <Link className="btn btn-outline-light m-4" href="#"><Image className="fab fa-twitter"></Image></Link>

              <Link className="btn btn-outline-light m-4" href="#"><i className="fab fa-instagram"></i></Link>

              <Link className="btn btn-outline-light m-4" href="#"><i className="fab fa-google"></i></Link>

              <Link className="btn btn-outline-light m-4" href="#"><i className="fab fa-pinterest"></i></Link>
            </div>
            </Col>
     </Nav>
  );
}


